3.  The `@ApplicationScoped` annotation indicates that the bean is created once and shared across the application.
4.  We also need to consider the impact on external dependencies in the `pom.xml` file. Since we are moving from Java EE to Quarkus, we need to ensure that the Quarkus CDI extension is included in the `pom.xml` file.
